import { View,Text,StyleSheet } from "react-native"



const Home = () =>{
    return(
        <View style={styled.homeContainer}>
            <Text style={styled.homeText}>Home</Text>
        </View>
    )
}

const styled = StyleSheet.create({
    homeContainer:{

    },
    homeText:{
        fontSize:24,
        color:'red'
    }
})

export default Home;
